<html>
    <head>
        <title>Good Job Bingo</title>
        <style type="text/css">
            body {
                margin: 0;
                background: tan;
                font-family: "Courier New", Courier, monospace;
                font-weight: 600;
            }
            main {
                width: 800px;
                max-width: 90vw;
                margin: 50px auto;
            }
            section {
                margin: 2rem 0;
            }
            details > summary::marker,
            details > summary::-webkit-details-marker {
                display: none;
            }
            details > summary {
                margin: 1rem 0;
                color: seagreen;
                cursor: zoom-in;
            }
            details > summary::before {
                content: "[show options]";
            }
            details[open] > summary::before {
                content: "[hide options]";
            }
            details[open] > summary {
                cursor: zoom-out;
            }
            details > summary:hover {
                color: steelblue;
            }
            #grid {
                display: grid;
                grid-template-columns: 20% 20% 20% 20% 20%;
                grid-template-rows: 20% 20% 20% 20% 20%;
                aspect-ratio: 1/1;
                border: 1px solid black;
                background-size: cover;
                background-position: center center;
                background-repeat: no-repeat;
            }
            button {
                color: black;
                background: white;
                border: 1px solid black;
                font: inherit;
                cursor: pointer;
                letter-spacing: 2px;
                line-height: 1.5rem;
            }
            button:hover {
                background: rgb(150, 200, 150);
            }
            .selected {
                background: rgba(255, 255, 255, 0.4);
            }
            .selected:hover {
                background: rgba(60, 60, 200, 0.2);
            }
            #options {
                display: grid;
                grid-template-columns: 20% 20% 20% 20% 20%;
                grid-template-rows: 20% 20% 20% 20% 20%;
                margin: 1rem 0;
            }
            #options > input {
                border: 1px solid black;
                font-family: inherit;
                font-size: inherit;
                font: inherit;
            }
        </style>
    </head>

            ];

            const readCookie = () => {
                if (!document.cookie) return {};
                return JSON.parse(document.cookie.split(";")[0].split("=")[1]);
            };

            const setCookie = () => {
                let expiresOn = new Date();
                expiresOn.setDate(
                    expiresOn.getDate() +
                        ((1 + 7 - expiresOn.getDay()) % 7 || 7)
                );
                document.cookie = `json=${JSON.stringify({
                    options,
                    selected,
                    expiresOn,
                })}; expires=${expiresOn}; path=/`;
            };

            const defaults = [
                "Contributed to a team goal",
                "Learned something new",
                "Asked a question in a meeting",
                "Answered a question in a meeting",
                "Used a company benefit",
                "Had a good conversation with a coworker",
                "Documented my work",
                "Cleaned up something old",
                "Showed up on time",
                "Fixed something that was broken",
                "Discovered something useful",
                "Followed through on a promise",
                "Scheduled a meeting",
                "Cancelled a meeting that could have been an email",
                "Sent an email",
                "Added a nice touch to something ordinary",
                "Complimented a colleague's good work",
                "Asked for help",
                "Paired with a colleague on a project",
                "Wrote down something I did well this week",
                "Caught up on company newsletters / updates",
                "Participated in a group activity",
                "Said 'no' when I'm too busy",
                "Made progress towards a personal goal",
                "Offered to help a colleague",
            ];

            const optionList = document.querySelector("#options");
            const defaultOptions = defaults
                .map((item) => {
                    return {
                        text: item,
                        d: Math.random(),
                    };
                })
                .sort((a, b) => a.d - b.d);
            let options = [...defaultOptions];

            let selected = new Array(25).fill(false);

            const c = (i) => {
                selected[i] = !selected[i];
                const button = document.querySelector(`#button${i}`);
                button.classList.toggle("selected");
                setCookie();
            };

            const reset = () => {
                const saved = readCookie();

                if (saved.options) options = saved.options;
                if (saved.selected) selected = saved.selected;

                const optionList = document.querySelector("#options");
                optionList.innerHTML = "";
                for (const [index, item] of options.entries()) {
                    const button = document.querySelector(`#button${index}`);
                    button.innerText = item.text;
                    if (selected[index]) {
                        button.classList.add("selected");
                    } else {
                        button.classList.remove("selected");
                    }
                    const input = document.createElement("input");
                    input.value = item.text;
                    input.addEventListener("change", (e) => {
                        options[index].text = e.target.value ?? "";
                        setCookie();
                        reset();
                    });
                    optionList.appendChild(input);
                }

                const grid = document.querySelector("#grid");
                grid.style.backgroundImage = `url('${
                    frogs[Math.floor(Math.random() * frogs.length)]
                }')`;

                if (saved.expiresOn) {
                    const displayDate = new Date(`${saved.expiresOn}`);
                    document.querySelector(
                        "#resetDate"
                    ).innerHTML = `Resets on ${displayDate.toDateString()}`;
                } else {
                    setCookie();
                }
            };

            const deleteCookie = () => {
                document.cookie =
                    "json={}; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;";
                options = [...defaultOptions];
                selected = new Array(25).fill(false);
                reset();
            };

            reset();
        </script>
    </body>
